import React from 'react';
import PropTypes from 'prop-types';

const foodILike = [
  {
    idx: 1,
    name: "kimchi",
    rating: "3.8",
    image: "data:image/jpeg;base64,"
  }, {
    idx: 2,
    name: "samgyubsal",
    rating: "4.5",
    image: "data:image/jpeg;base64,"
  }, {
    idx: 3,
    name: "ramen",
    rating: "4.1",
    image: "data:image/jpeg;base64,"
  }
];

function Food({name, image, rating}) {
  return (
    <div>
      <h3>I Like {name}</h3>
      <h2>with {rating}</h2>
      <img src={image} alt={name}/>
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  image: PropTypes.string.isRequired,
  rating: PropTypes.string.isRequired,
};

function App() {
  return (
    <div>
      {foodILike.map(f => <Food key={f.idx} name={f.name} image={f.image} rating={f.rating}/>)}
    </div>
  );
}

export default App;
